import React from 'react';
import Container from 'react-bootstrap/Container';
import Jumbotron from 'react-bootstrap/Jumbotron';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import  Parallax  from 'react-scroll-parallax';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import '../Styles/Home.css';
const Home = () => (





  <Container className="homeContainer" fluid = {true}>
  <Parallax>
  <Container>
  <link href="https://fonts.googleapis.com/css?family=Fredericka+the+Great|Lateef|Open+Sans|Rancho|Permanent+Marker&display=swap" rel="stylesheet"></link>
  <h1 className="homeText"> I am <span>Karishma</span> , </h1>
    <h5 className="homeText"> a Front-End Developer based in New York</h5>

</Container>
</Parallax>
    <Card style={{ width: '18rem' }}>
  <Card.Img variant="top" src="holder.js/100px180" />
  <Card.Body>
    <Card.Title>Card Title</Card.Title>
    <Card.Text>
      Some quick example text to build on the card title and make up the bulk of
      the card's content.
    </Card.Text>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
</Card>

  </Container>








)

export default Home;
